    false,nt"url": null,nt"notes": "NCEI Accession 0153496 includes physical
    and underway data collected aboard the Sikuliaq during cruise SKQ201508S in the
    Bering Sea, Gulf of Alaska and North Pacific Ocean from 2015-07-06 to 2015-07-14.
    These data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Kerry Key of University of California - San Diego;
    Scripps Institution of Oceanography, and by University of Alaska - Fairbanks as
    part of Magnetotelluric and Seismic Investigation of Okmok Volcano. The Lamont-Doherty
    Earth Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored
    Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
